('1', 'Main Street Guitar 38-inch', NULL, 8000, 'sk', 'products', 'The Main Street MAS38BK Acoustic Guitar features a cutaway body with a Black finish. It has a linden top, back and sides, catalpa neck and maple bridge and fingerboard. The acoustic guitar also features a non-adjustable truss rod, cream body and fingerboard binding and brass frets.\r\n\r\nFeatures\r\n\r\nMain Street 38-Inch, acoustic cutaway body design\r\nHigh-gloss, black finish\r\nLinden top, back & sides\r\nSteel strings\r\nCatalpa Neck with non-adjustable truss rod\r\nDark-stained maple fretboard and bridge\r\n3:1 ratio plank-style tuners with chrome tuning keys\r\n19 Brass frets with neck joining the body at the 12th fret\r\nCream body and neck binding\r\nOverall Size: 37.75 IN L x 14.13 IN W x 4 IN D\r\nWeight: 3.35 Pounds\r\nCream fingerboard binding\r\nMaple bridge'),
('2', 'World Tech Toys 35979 WiFi Controlled i-Spy Tank W', NULL, 3212, 'kk', 'products', 'Want to watch your RC Tank drive directly from the cockpit? Take a look at the LIVE VIDEO WiFi Control Electric RTR iSpy Tank! This awesome RC Spy Tank uses your Apple products as the remote controller with a connected via WiFi. It even has a built in Hi-Res camera which shoots a Live Video Feed to your iDevice. You can record video and take pictures with the camera. The full function control allows you to move forward, backward, and turn left and right. The tilt angle of the camera is also controlled through your iDevice so you can make the camera look straight or tilt up. All you need to do is download the free app from the Apple app store and you''re good to go!\r\n\r\nFeatures\r\n\r\nElectric Powered\r\nBuilt-In Color Hi-Res Video Camera\r\nControl The Tank With Your i-Device: iPod Touch, iPad, iPhone\r\nWiFi Controlled\r\nMotion Tilt or Touch Controls\r\nLive Video Feed\r\nRecords Hi-Res Video\r\nTakes Hi-Res Pictures\r\nLED Lights\r\nReady To Run\r\n'),
('3', 'Jessica Baker 0.15cttw Sterling Silver Enhanced Blue & White Diamond Teardrop-Shaped Earrings', NULL, 30000, 'sd', 'products', 'Regal and radiant, these drop earrings elevate any attire. Expertly crafted in sterling silver, each simple hoop earring sports a teardrop-shaped, diamond-lined drop. Each drop is centered with a single alluring enhanced blue diamond accent, adding a bright pop of color and sparkle. Glistening with 0.14 carat total weight of diamonds and a bright polished shine, these earrings secure with hinged backs. Timeless pieces that always exude grace, class, and a sense of fashion. A gorgeous addition to any jewelry collection. Arrives in a free gift box, ready for that special someone.\r\n\r\nFeatures\r\n\r\nEarrings\r\nMaterial: Sterling silver\r\nTeardrop-shaped\r\nEach drop is centered with a single alluring enhanced blue diamond accent\r\nArrives in a free gift box'),
('4', 'Walmart Gift Card', NULL, 350, 'ks', 'products', 'A worldwide household name, Walmart carries general merchandise including groceries, apparel, household goods, electronics, furniture, and much more at Everyday Low Prices. Gift cards can also be used at Sam’s Club, Walmart’s warehouse membership stores.  Give the Walmart gift card any time of year. It''s the ideal gift for family and friends, because they can choose just what they have in mind.\r\n\r\nFor purchases at Walmart.com and in U.S. Walmart stores\r\nFor purchases by SAM''S Club members in U.S. SAM''S Club stores and at Samsclub.com\r\nIn stores, present the card at checkout\r\nOnline, enter card number and PIN (on back of card) during checkout. The PIN provides secure online shopping.\r\nAs you make purchases, the card amount decreases. Add to card balance anytime in a Walmart store. (You cannot add to the balance online.)\r\nCheck your card balance in stores or online\r\nFeatures\r\n\r\nEasy to Use\r\nNo Expiration Date\r\nFor purchases at Walmart.com and in U.S. Wal-Mart stores'),
('5', 'Beats By Dre Executive Over-Ear Headphone - Black', NULL, 700, 'kk', 'products', 'Beats Executive Headphones are designed to take you from the private jet to the boardroom, VIP party to the penthouse. The same legendary sound in a refined premium package, designed exclusively for life on the road. These elegantly designed, superb audio-producing headphones are the perfect balance of luxury and function. Beats Executive headphones feature noise-canceling technology and long-wearing comfort for true music enjoyment. Designed for first class travel, they’re lightweight, comfortable to wear, and fold flat for easy packing. Powerful enough to Block out a jet engine, Beats Executive headphones use battery-powered noise cancellation to deliver your music without outside interruption.\r\n\r\nFeatures\r\n\r\nCrafted to provide crisp, uninterrupted sound with the best quality materials\r\nAluminum body ensures a durable product with soft leather cushions delivering balanced audio\r\nLightweight but sturdy materials and a unique folding design\r\nActive Noise Cancellation'),
